export default()=>{const t=document.getElementById("navbarSupportedContent");t.addEventListener("transitionend",(function(){this.classList.remove("transition")})),document.querySelector("nav.navbar button").addEventListener("click",(function(){"false"===this.ariaExpanded?(t.classList.add("transition"),t.classList.add("show"),this.ariaExpanded="true"):(t.classList.add("transition"),t.classList.remove("show"),this.ariaExpanded="false")}))};